import React from 'react';
import taboo from './taboo.png';
import diamond from './diamond.jpg';
import heart from './heart.jpg';
import spade from './spade.jpg';
import { Link } from 'react-router-dom';

class Taboo extends React.Component{

  constructor(props) {
    super(props);
    this.state = {
      cardstaboo:
        { term: "Michael" , taboos: ["genius", "master", "hurlbut"] }
    };
  }

  render(){

    return(
      <div>
        Taboo
        <div style = {{height: "100px", width: "50px", padding: "50px", border: "1px solid black"}}>
          <img src = {taboo} alt="suit" width="40px" height="80px"/>
          {this.state.cardstaboo.term}
        </div>
        <br/><br/>
        <Link to="/">Go home!</Link>
      </div>
    );
  }
}

export default Taboo;
